import styled from "styled-components";

export const LoginWrapper = styled.div`

    h1 {
        margin: 10px;
    }

    .container {
        display:flex;
        justify-content: center;
        flex-direction: column;
        align-items: center;
        align-content: center;
        margin: 50px;
        margin-left: 120px;
        border: 1px solid black;
    }

    #image {
        width:50%;
        height: 500px;
    }

    div {
        margin: 10px;
    }

`;
